import React, { Component } from 'react';

class Home extends Component {
    render() {
        return (

                        <div style={{textAlign:"left",fontFamily:'monospace'}}>
                <h3 style={{textAlign:"left",fontFamily:'monospace'}} class="text-danger"><strong>Hello there! My name is Tasnim Ali and I am a software developer who designs fullstack web applications. </strong></h3>
                <br />
                <h4 style={{textAlign:"left",fontFamily:'monospace'}} class="text-danger">Have a project or opportunity you'd like to discuss?</h4>
                <h4 style={{textAlign:"left",fontFamily:'monospace'}} class="text-danger">Let's talk ✉️ <a class="text-primary" href="mailto:rajonali44492@icloud.com">rajonali44492@icloud.com</a></h4>
            </div>
        );
    }
}

export default Home;
